import { ApolloProvider } from '@apollo/client';
import React from 'react';
import './App.css';
import Main from './components/Main.js';

const client = require('./index')

function App() {

	return (
		<ApolloProvider client = {client}>
			<div className="App">
				<Main />
			</div>
		</ApolloProvider>
	);
}

export default App;
